import React, { Component } from 'react';
import './App.css';
import WildPokemonMap from './containers/WildPokemonMap'



class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      pokemon: []
    }
  }

  render() {
    return (
      <div className="App">
        <WildPokemonMap />
      </div>
    );
  }
}

export default App;
